const deleteProduct = async (id) => {
    const response = await fetch(`http://localhost:3333/deletar/${id}`, {
        headers: {
            cookies: localStorage.getItem('jwt'),
        },
        credentials: 'include'
        })
    return response.json()
}

export default deleteProduct
